// Textbox.tsx
import React from 'react';
import { CSSProperties } from 'react';

interface TextboxProps {
  id: string;
  x: number;
  y: number;
  h: number;
  w: number;
  content: string;
}

const Textbox: React.FC<TextboxProps> = ({ id, x, y, h, w, content }) => {
  const style: CSSProperties = {
    position: 'absolute', 
    left: `${x}px`,
    top: `${y}px`,
    height: `${h}px`,
    width: `${w}px`,
    border: '1px solid black',
    padding: '5px',
  };

  return (
    <div id={id} className="textbox" style={style}>
      {content}
    </div>
  );
};

export default Textbox;
